import React, { Fragment } from 'react';
import './App.css';
import { ToastContainer } from 'react-toastify';
import 'react-toastify/dist/ReactToastify.css';

// Components
import UserProvider from './utils/UserProvider';
import AppRouter from './routes/AppRouter';

function App() {
  return (
  <Fragment>
    <UserProvider>
      <ToastContainer />
        <AppRouter />
    </UserProvider>
  </Fragment>
  );
}

export default App;
